import React from "react";
import { Nav, Navbar } from "react-bootstrap";
import styled from "styled-components";
import logo from '../images/swiftlogo.png'



const Styles = styled.div`
  .navbar {
    background-color: #1949ad;
  }
  .navbar-brand,
  .navbar-nav .nav-link {
    color: #f5f6fa;
    &:hover {
      color: #ced6e0;
    }
  }
`;


export const Navigbar = () => (
  <Styles>
    <Navbar expands="lg">
      <Navbar.Brand href="/"><img src={logo}
       style={{width:50,marginTop:-10,marginBottom:-10}} class='img-responsive' alt="logo" /></Navbar.Brand>
      <Navbar.Brand href="/" style={{padding:10,fontSize:25 }} > <strong>Swift Chemicals</strong> </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Item>
            <Nav.Link href="/">Home</Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link href="/service">Services</Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link href="/team">Our Team</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link href="/contact">Contact</Nav.Link>
          </Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </Styles>
);
